import java.util.Date;

class Event implements Comparable <Event>{
    Date begin, end; // początek i koniec wydarzenia
    Event(Date b, Date e) {
        this.begin = b;
        this.end = e;
    }
    
    public long getDuration(Event e) { 
       return compareTo(e)/1000;
    }
    
    @Override
    public String toString() { // zamień obiekt na String i zwróć wynik
        return this.begin.toString() + this.end.toString();
    }
    
	@Override
	public int compareTo(Event e) {
        int compareDates = e.end.compareTo(e.begin);               
        return compareDates;
	}
}

